import Yo from "./Imagenes/Yo.jpeg";
export default function SobreMi(){
    return(
        <div>

            <div>
                <img src={Yo}/>
            </div>
            <div>
                <p>Hola!, Me llamo Luis Duran, Soy de Argentina y este es mi proyecto de Rick and Morty, espero que si alguien lo ve despierte en el las ganas de hacer el suyo y mucho mejor que este!</p>
            </div>

        </div>
    )
}
